import Aside from './Aside.js';
import Header from './Header.js';
import Footer from './Footer.js';
import Home from './Home.js';
import './css/App.css';


function App() {
  return (
    <>
      <Header/>
      <div className='container'>
        <Aside/>
        <Home/>
      </div>
      <Footer/>
    </>
  );
}

export default App;
